          submenuitem:
            '<li {{#className}}class="{{className}}"{{/className}}>{{#url}}<a href="{{url}}">{{/url}}{{#sprite}}<span class="sprite {{sprite}}">&nbsp;</span>{{/sprite}}{{#text}}<span class="game-label">{{#platform}}<i class="fas fa-{{platform}}"></i>{{/platform}}{{text}}</span>{{/text}}{{#img}}<img src="{{img}}">{{/img}}{{#url}}</a>{{/url}}{{#links}}<ul class="sub-links">{{/links}}{{#links-items}}{{> lilink}}{{/links-items}}{{#links}}</ul>{{/links}}</li>',
          text: "{{#text}}{{text}}{{/text}}",
          image: '{{#img}}<img src="{{img}}">{{/img}}',
          link:
            '{{#currency}}{{> currency }}{{/currency}}{{#url}}<a href="{{prefix}}{{url}}{{#suffixServiceCode}}{{serviceCode}}{{/suffixServiceCode}}">{{/url}}{{> image }}<span>{{> text }}</span>{{> sprite }}{{#url}}</a>{{/url}}',
          lilink:
            '<li {{#className}}class="{{className}}"{{/className}}>{{> link}}</li>',
          sprite:
            '{{#sprite}}<span class="sprite {{ sprite }}">&nbsp;</span>{{/sprite}}',
          lang:
            '<li><div class="gnb-lang"><a>{{language.v}}<span class="sprite caret"></span></a><ul>{{#languages}}<li class="gnb-lang-select" data-key={{k}}><a href="{{path}}">{{v}}</a></li>{{/languages}}</ul></div></li>',
